import React, { useState, useEffect } from 'react';
import Tour from './Tour';

const Tours = ({toursData, deleteTour}) => {
  let counter = 0;

  return (
    <>
      <h1 className="title">Tours</h1>
        {toursData.map(tour => (
          <div>
            <Tour id={counter++} toursData={toursData} deleteTour={deleteTour} />

          </div>
        ))}
    </>
  );
};

export default Tours;
